#include <iostream>
#include <string>
#include <fstream>
using namespace std;


string makeReverse(string input){
    string rev(input.size(),' ');
    for(int i = input.size()-1,j=0 ;i>=0; --i,++j)
        switch (input[i]) {
        case 'A':rev[j] = 'T'; break;
        case 'T':rev[j] = 'A'; break;
        case 'C':rev[j] = 'G'; break;
        case 'G':rev[j] = 'C'; break;
        default:
            break;
        }
    return rev;
}


